INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES ("2030/01/01 14:59:59", "ヤマト", "2024/10/31 12:00:00", "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", 2.1, 0.0, 2, 1, -416.5, 3001, 100, 130011, 3001100);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES ("2030/01/01 14:59:59", "ヤマト", "2024/10/31 12:00:00", "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", 5.68, 0.0, 2, 4, -416.5, 3001, 101, 130011, 3001101);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES ("2030/01/01 14:59:59", "ヤマト", "2024/10/31 12:00:00", "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", 0.0, 0.0, 1, 1, -416.5, 3001, 102, 130011, 3001102);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES ("2030/01/01 14:59:59", "フブキ", "2024/10/31 12:00:00", "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", 0.0, 0.0, 1, 1, -416.5, 3002, 100, 130211, 3002100);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES ("2030/01/01 14:59:59", "フブキ", "2024/10/31 12:00:00", "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", 0.0, 0.0, 1, 1, -416.5, 3002, 101, 130211, 3002101);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES ("2030/01/01 14:59:59", "フブキ", "2024/10/31 12:00:00", "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", 8.53, 0.0, 2, 5, -416.5, 3002, 102, 130211, 3002102);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES ("2030/01/01 14:59:59", "フブキ", "2024/10/31 12:00:00", "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", 5.67, 0.0, 1, 7, -416.5, 3002, 103, 130211, 3002103);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES ("2030/01/01 14:59:59", "フブキ", "2024/10/31 12:00:00", "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", 0.0, 0.0, 1, 1, -416.5, 3002, 104, 130211, 3002104);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES ("2030/01/01 14:59:59", "フブキ", "2024/10/31 12:00:00", "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", 0.0, 0.0, 3, 3, -416.5, 3004, 300, 130211, 3002300);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES ("2030/01/01 14:59:59", "フブキ", "2024/10/31 12:00:00", "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", 0.0, 0.0, 7, 7, -416.5, 3005, 301, 130211, 3002400);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES ("2030/01/01 14:59:59", "フブキ", "2024/10/31 12:00:00", "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", 4.4, 0.0, 1, 2, -416.5, 3003, 200, 130211, 3003200);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES ("2030/01/01 14:59:59", "フブキ", "2024/10/31 12:00:00", "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", 0.0, 0.0, 7, 7, -416.5, 3003, 201, 130211, 3003201);
